import React from 'react';

const Pomodoro = () => {
  return (
    <div>
      <h1 className="text-3xl font-bold mb-4">Pomodoro Timer</h1>
      <p>Stay focused with the Pomodoro technique.</p>
    </div>
  );
};

export default Pomodoro;
